import React from 'react'
import AChart from "react-apexcharts";

const Seeds= ({todos, options}) =>{
    console.log(todos);
    const todoList = todos.length ? (
        todos.map( todo=> {
            return(
                <div className="card">
                <AChart
                options={options}
                series={[todo]}/>
                </div>
            );
        }
        )
    ) : (
        <p className="center">Loading</p>
    );
    return(
        <div className="container">
            {todoList}
        </div>

    );
}

export default Seeds;
